import "./DhondtElectionRegion.sol";
import "./PollingStation.sol";

contract DhondtPollingStation is PollingStation, DhondtElectionRegion {
    
    // 1. Añadimos la variable para guardar la dirección de la autoridad
    address private creador;

    constructor(address _president, uint _numParties, uint _regionId) 
        PollingStation(_president) 
        DhondtElectionRegion(_numParties, _regionId) 
    {
        // 2. Asignamos quién es la autoridad (el que despliega el contrato)
        creador = msg.sender; 
    }

    // 3. Añadimos el modificador según tu captura de pantalla
    modifier onlyAuthority() {
        require(msg.sender == creador, "error no autorizado"); 
        _;
    }

    function castVote(uint _partyId) external override onlyIfOpen {
        bool success = registerVote(_partyId); 
        if (!success) revert("Identificador de partido no valido");
    }

    // 4. Aplicamos el modificador 'onlyAuthority' a la función de resultados
    function getResults() external view override onlyAuthority returns (uint[] memory) {
        if (!votingFinished) revert("La votacion aun no ha terminado"); 
        return results; 
    }
}

lab3/PollingStation.sol.content:
abstract contract PollingStation {
    address public president; // [cite: 51]
    bool public votingFinished = false; // [cite: 46]
    bool private votingOpen = false; // [cite: 47]

    modifier onlyPresident() {
        require(msg.sender == president, "Solo el presidente puede hacer esto"); // [cite: 62]
        _;
    }

    modifier onlyIfOpen() {
        require(votingOpen && !votingFinished, "La votacion no esta abierta"); // [cite: 55, 60]
        _;
    }

    constructor(address _president) {
        president = _president; // [cite: 53]
    }

    function openVoting() external onlyPresident {
        require(!votingFinished, "La votacion ya finalizo");
        votingOpen = true; // [cite: 54]
    }

    function closeVoting() external onlyPresident {
        votingOpen = false;
        votingFinished = true; // [cite: 56, 57]
    }

    // Funciones que implementara el hijo [cite: 58]
    function castVote(uint _partyId) external virtual;
    function getResults() external virtual returns (uint[] memory);
}

lab3/DhondtElectionRegion.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.5;

contract DhondtElectionRegion {
    uint internal regionId;
    mapping (uint => uint) private weights; // [cite: 22]
    uint[] internal results; // [cite: 34]

    constructor(uint _numParties, uint _regionId) {
        regionId = _regionId; // [cite: 32]
        results = new uint[](_numParties); // [cite: 35]
        savedRegionInfo(); // Inicializa los pesos [cite: 23]
    }

    function savedRegionInfo() private {
        weights[28] = 1; // Madrid [cite: 24]
        weights[8] = 1;  // Barcelona [cite: 26]
        weights[41] = 1; // Sevilla [cite: 26]
        weights[44] = 5; // Teruel [cite: 27]
        weights[42] = 5; // Soria [cite: 28]
        weights[49] = 4; // Zamora [cite: 29]
        weights[9] = 4;  // Burgos [cite: 29]
        weights[29] = 2; // Malaga [cite: 30]
    }

    // Registra el voto aplicando el peso de la región [cite: 38]
    function registerVote(uint _party) internal returns (bool) {
        if (_party >= results.length) return false; // [cite: 39]
        
        uint weight = weights[regionId] > 0 ? weights[regionId] : 1;
        results[_party] += weight; // [cite: 40]
        return true; // [cite: 41]
    }
}

